import React, { useEffect, useState } from 'react'
import {IonPage, IonContent, IonItem, IonHeader,
    IonToolbar, IonButtons, IonBackButton, IonTitle, IonText} from '@ionic/react'

import { SortItems } from '../components/frontend/sort-items'


import { brewsSettingsFileName } from '../components/objects/filenames'
//import { useEffect } from 'react'

const fileName = brewsSettingsFileName  //filename übergeben
const type = 'brews'



export const BrewsSettings = () => {

    return (
        <IonPage>
            <IonHeader>
                <IonToolbar>
                <IonTitle>Einstellungen Brühungen</IonTitle>
                <IonItem>
                    <IonText>Hier kann festgelegt werden, welche Felder zum Anlegen von Brühungen zur Verfügung stehen und in welcher Reihenfolge sie angezeigt werden.</IonText>
                </IonItem>
                </IonToolbar>

                </IonHeader>
                <IonContent>
                    {SortItems(fileName, type)}
                    {/*SortItems(fileName, JSON.parse(JSON.stringify(fields)))*/}
                </IonContent>
        </IonPage>
    )
}
